import "./header.scss"
import React, { Component } from 'react'

class Header extends Component {
    render() {
        return (
            <div>
                <ul>
                    <li>Match</li>
                    <li>About</li>
                    <li>Contact</li>
                </ul>
            </div>
        )
    }
}

export default Header
